function getRestaurants(o,n){var a="https://shitfoodapi.azurewebsites.net/api/getshit?lat="+o+"&lng="+n;axios.get(a).then(function(o){for(var n=0;n<o.data.length;n++)L.marker([o.data[n].lat,o.data[n].lng],{icon:cutleryIconColour(o.data[n].foodHygieneRating),alt:o.data[n].name,title:o.data[n].name}).addTo(mymap).bindPopup("<strong>"+o.data[n].name+"</strong><br>Food Hygiene Rating: "+o.data[n].foodHygieneRating);console.log(o.data)}).catch(function(o){console.log(o)})}function cutleryIconColour(o){return"2"===o?L.icon({iconUrl:"./img/markers/cutlery-yellow.svg",iconSize:[36,36],iconAnchor:[-18,-18],popupAnchor:[34,0]}):"1"===o?L.icon({iconUrl:"./img/markers/cutlery-orange.svg",iconSize:[36,36],iconAnchor:[-18,-18],popupAnchor:[34,0]}):"0"===o?L.icon({iconUrl:"./img/markers/cutlery-red.svg",iconSize:[36,36],iconAnchor:[-18,-18],popupAnchor:[34,0]}):L.icon({iconUrl:"./img/markers/cutlery.svg",iconSize:[36,36],iconAnchor:[-18,-18],popupAnchor:[34,0]})}